script: |
  super -f text -I q96.spq | sort > q96.out

inputs:
  - name: q96.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT ( NOT - col1 * - + col2 * - col2 / col2 + + 61 NOT IN ( - - col1 ) );
  - name: tab1

outputs:
  - name: q96.out
    data: |
      51	14	96
      85	5	59
      91	47	68
